import { BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Home from './Page/Home'
import List from './Page/List'
import Post from './Page/Post'

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route path='/' exact component={Home}/>
        </Switch>
      </Router>
    </>
  );
}

export default App;
